import React from 'react'
import styles from './ButtonCourseItem.module.scss'

const ButtonCourseItem = (props) => {
  const { type } = props
  const handleClick = () => {

  }
  const ButtonTypeCase = () => {
    switch (type) {
      case 'addToCart':
        return <button
          className={styles.buttonAddToCart}
          onClick={handleClick}
          type="button"
        >
          Add to cart
        </button>
      case 'buyNow':
        return <button
          className={styles.buttonBuyNow}
          onClick={handleClick}
          type="button"
        >
          Buy now
        </button>
      case 'learnNow':
        return <button
          className={styles.buttonLearnNow}
          onClick={handleClick}
          type="button"
        >
          Learn now
        </button>
      case 'extend':
        return <button
          className={styles.buttonExtend}
          onClick={handleClick}
          type="button"
        >
          Extend
        </button>

      default:

        return <button
          className={styles.buttonAddToCart}
          onClick={handleClick}
          type="button"
        >
          Add to cart
        </button>
    }
  }
  return (
    <div className={styles.container}>
      <ButtonTypeCase />
    </div>
  )
}
export default ButtonCourseItem
